import React, { useState, useEffect } from 'react'
import UsersToList from "../components/UsersToList"

function View2() {
    const [data, setData] = useState([]);

    useEffect(() => {
        fetch("/view2").then(
            res => res.json()
        ).then(
            data => {
                setData(data)
            }
        )
    }, [])

    console.log("Input Type:")
    console.log(typeof(data.list))
    console.log("Input:")
    console.log(data)

    return (
        <div>
            <h1>This is the View 2 page</h1>
        </div>
    )
}

export default View2;
